import React, { useState } from "react";
import Up from "../../assets/Filter/up.png";
import Down from "../../assets/Filter/down.png";
import "./BrandFilter.css";

export default function BrandFilter() {
  const [isPriceDropdownOpen, setIsPriceDropdownOpen] = useState(false);
  const [fromPrice, setFromPrice] = useState("");
  const [toPrice, setToPrice] = useState("");
  const [isMemorydownOpen, setIsMemoryDropdownOpen] = useState(false);
  const togglePriceDropdown = () => {
    setIsPriceDropdownOpen(!isPriceDropdownOpen);
  };
  const toggleMemoryDropdown = () => {
    setIsMemoryDropdownOpen(!isMemorydownOpen);
  };
  const handleApplyFilter = () => {
    // Implement your logic for applying the filter with the price range (fromPrice and toPrice)
    console.log(`Filter Applied: From ${fromPrice} to ${toPrice}`);
  };

  return (
    <div className="BrandFilter">
      <div className="brandHead">
        <p>Brand</p>
        <div onClick={togglePriceDropdown}>
          {isPriceDropdownOpen ? <img src={Up} /> : <img src={Down} />}
        </div>
      </div>

      <hr />
      {isPriceDropdownOpen && (
        <div className="priceRange">
          <label>
            <input className="check" type="checkbox" />
            Apple
          </label>
          <label>
            <input className="check" type="checkbox" />
            SamSung
          </label>
          <label>
            <input className="check" type="checkbox" />
            Poco
          </label>
          <label>
            <input className="check" type="checkbox" />
            Oppo
          </label>
        </div>
      )}
      <div className="brandHead">
        <p>Build-in Memory</p>
        <div onClick={toggleMemoryDropdown}>
          {toggleMemoryDropdown ? <img src={Up} /> : <img src={Down} />}
        </div>
      </div>

      <hr />
      {toggleMemoryDropdown && (
        <div className="priceRange">
          <label>
            <input className="check" type="checkbox" />
            16GB
          </label>
          <label>
            <input className="check" type="checkbox" />
            64GB
          </label>
          <label>
            <input className="check" type="checkbox" />
            128GB
          </label>
          <label>
            <input className="check" type="checkbox" />
            Oppo
          </label>
        </div>
      )}
    </div>
  );
}
